BlocklyGamesMsg["Pond.helpUseScan"] = "Iṣẹ ojutu rẹ ṣiṣẹ, ṣugbọn o le ṣe dada sii. Lo 'ayẹwo' lati sọ bi ibon naa se rin jina to.";
BlocklyGamesMsg["Pond.helpText1"] = "Lo aṣẹ 'ibon' lati ba awọn afojusun naa. Ipele akọkọ jẹ igun naa, ipele keji ni sakani. Wa ajosepo to gun rege.";
BlocklyGamesMsg["Pond.helpText2"] = "Afojusun yii nilo lati lu ni ọpọlọpọ igba. Lo 'nigbati (otitọ) 'lupu lati ṣe nkan ni kiakia.";
BlocklyGamesMsg["Pond.helpText3a"] = "Alatako yii n lọ sẹyin ati siwaju, jẹ o ko ṣòro lati lu. Ọrọ 'ayẹwo' naa tun da ibi gangan pada si ibi ti ialatako ni ọna kan pàtó.";
BlocklyGamesMsg["Pond.helpText3b"] = "Ibi afojusun yi jẹ ohun gangan ti aṣẹ 'ibọn' nilo lati tan ni deede.";
BlocklyGamesMsg["Pond.helpText4"] = "Alatako yi jina ju lati lo ibọn (ti o ni odiwọn of 70 mitta). Dipo, lo asẹ 'iwe' lati beere iwe wiwe si odo alatako ki o wọ inu rẹ lọ.";
BlocklyGamesMsg["Pond.helpText5"] = "Alatako yi jina ju lati lo ibọn. Sugbọn o ko ni okun lati yẹẹ ti o ba forigbari. Wẹ lo sọdọ alatako nigbati ibi ti o wa ko to 50. Leyinna da 'duro' ki o si lo ibọn.";
BlocklyGamesMsg["Pond.helpText6"] = "Alatako yi yoo lọ kuro nigbati o ba lu. Wẹ lọ si ọna ti o ba wa ni ibiti a ti le ri (70 mitta).";
